import React from 'react';
import './css/Content.css';

export default class Content extends React.Component {

    componentWillMount(){
        let url = window.location.href;
        let cont = url.split('?');
        alert('Email: ' + cont[1] + "\nSenha: " + cont[2]);
    }

    render(){
        return(
            <div className="content">
                
            </div>
        );
    }
}
